지속 암흑 피해 효과가 피해를 줄 때마다 {c_number}[{SF_0}*100|%x|]{/c} 확률로 {c_number}[{SF_1}*100|%x|]{/c}의 추가 피해를 줍니다. 지능 {c_number}[{SF_4}]{/c}당 확률이 {c_number}[{SF_2}*100|%x|]{/c}, 추가 피해가 {c_number}[{SF_3}*100|%x|]{/c} 증가합니다.

현재 확률: {c_number}[SF_6 * 100|%|]{/c}
현재 추가 피해: {c_number}[SF_5 * 100|%x|]{/c}
